-- ----------------------------
-- Table structure for litemall_goods
-- ----------------------------
DROP TABLE IF EXISTS `litemall_goods`;
CREATE TABLE `litemall_goods`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `goods_sn` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品编号',
  `name` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品名称',
  `brand_id` int(0) NULL DEFAULT NULL,
  `gallery` varchar(1023) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品宣传图片列表，采用JSON数组格式',
  `keywords` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '商品关键字，采用逗号间隔',
  `brief` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '商品简介',
  `is_on_sale` tinyint(1) NULL DEFAULT 1 COMMENT '是否上架',
  `sort_order` smallint(0) NULL DEFAULT 100,
  `pic_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品页面商品图片',
  `share_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品分享朋友圈图片',
  `is_new` tinyint(1) NULL DEFAULT 0 COMMENT '是否新品首发，如果设置则可以在新品首发页面展示',
  `is_hot` tinyint(1) NULL DEFAULT 0 COMMENT '是否人气推荐，如果设置则可以在人气推荐页面展示',
  `unit` varchar(31) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品单位，例如件、盒',
  `counter_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '专柜价格',
  `retail_price` decimal(10, 2) NULL DEFAULT 100000.00 COMMENT '零售价格',
  `detail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品详细介绍，是富文本格式',
  `add_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NULL DEFAULT 0 COMMENT '逻辑删除',
  `com_id` int(0) NULL DEFAULT NULL COMMENT '所属公司ID',
  `com_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '商品名称',
  `category_name` varchar(1023) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属类目名称',
  `brand_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属品牌名称',
  `goods_barcode` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品条码',
  `store_id` int(0) NULL DEFAULT NULL COMMENT '所属店铺ID',
  `store_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '所属店铺名称',
  `if_xuni` tinyint(1) NULL DEFAULT 0 COMMENT '是否虚拟商品',
  `if_use_coupon` tinyint(1) NULL DEFAULT 0 COMMENT '是否可用优惠券 0-否 1-是',
  `if_use_bonus` tinyint(1) NULL DEFAULT 0 COMMENT '是否可用积分 0-否 1-是',
  `if_store_bigger_zero` tinyint(1) NULL DEFAULT 0 COMMENT '商品下可能用多个规格型号，其中任一规格型号库存大于零则为1，做为一个是否可销售的标志',
  `tenant_id` int(0) NULL DEFAULT NULL COMMENT '租户ID',
  `user_create_id` int(0) NULL DEFAULT NULL COMMENT '外部创建用户Id',
  `user_modify_id` int(0) NULL DEFAULT NULL COMMENT '外部修改用户Id',
  `op_create_id` int(0) NULL DEFAULT NULL COMMENT '内部后台创建用户Id',
  `op_modify_id` int(0) NULL DEFAULT NULL COMMENT '内部后台修改用户Id',
  `default_product_id` int(0) NULL DEFAULT NULL COMMENT '默认商品规格Id',
  `if_ticket` tinyint(1) NULL DEFAULT 0 COMMENT '是否CRM购券 0-否 1-是',
  `if_list_goods` tinyint(1) NULL DEFAULT 1 COMMENT '是否列表商品 0-否 1-是 默认1',
  `gallery_big` varchar(1023) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品宣传图片大图列表，采用JSON数组格式',
  `used_range` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '电商专用' COMMENT '商品应用类型:  电商专用  拍卖专用  全场通用',
  `author_id` int(0) NULL DEFAULT NULL COMMENT '出品人ID',
  `dajiapai_category_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属大家拍分类目编码',
  `dajiapai_category_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属大家拍分类目名称',
  `private_category_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属私人定制类目编码',
  `private_category_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属私人定制类目名称',
  `category_id` int(0) NULL DEFAULT NULL COMMENT '商品所属电商类目ID',
  `author_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '出品人名称',
  `category_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '所属电商类目编码',
  `dajiapai_category_id` int(0) NULL DEFAULT NULL COMMENT '所属大家拍分类ID',
  `private_category_id` int(0) NULL DEFAULT NULL COMMENT '所属私人定制分类ID',
  `price_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '描述价格',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `goods_sn`(`goods_sn`) USING BTREE,
  INDEX `brand_id`(`brand_id`) USING BTREE,
  INDEX `sort_order`(`sort_order`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1181584 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '商品基本信息表' ROW_FORMAT = Compact;

