-- ----------------------------
-- Table structure for litemall_order
-- ----------------------------
DROP TABLE IF EXISTS `litemall_order`;
CREATE TABLE `litemall_order`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `user_id` int(0) NULL DEFAULT NULL COMMENT '用户表的用户ID',
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户名称',
  `user_nickname` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户昵称',
  `user_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户电话',
  `crm_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员编号',
  `crm_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员姓名',
  `order_sn` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单编号',
  `order_status` smallint(0) NULL DEFAULT NULL COMMENT '订单状态',
  `order_status_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单状态名称',
  `consignee` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '收货人名称',
  `mobile` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '收货人手机号',
  `address` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '收货具体地址',
  `message` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '用户订单留言',
  `goods_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '商品总费用',
  `freight_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '配送费用',
  `coupon_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '优惠券减免',
  `integral_bonus` decimal(10, 2) NULL DEFAULT NULL COMMENT '用户使用了多少积分',
  `integral_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '用户积分减免',
  `groupon_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '团购优惠价减免',
  `order_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '订单费用， = goods_price + freight_price - coupon_price',
  `actual_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '实付费用， = order_price - integral_price',
  `pay_method` int(0) NULL DEFAULT NULL COMMENT '支付方式 1-支付宝 2-微信',
  `pay_method_name` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方式名称 1-支付宝 2-微信',
  `pay_id` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微信付款编号',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '微信付款时间',
  `ship_sn` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发货编号',
  `ship_channel` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发货快递公司',
  `ship_time` datetime(0) NULL DEFAULT NULL COMMENT '发货开始时间',
  `confirm_time` datetime(0) NULL DEFAULT NULL COMMENT '用户确认收货时间',
  `comments` smallint(0) NULL DEFAULT 0 COMMENT '待评价订单商品数量',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '订单关闭时间',
  `cancel_time` datetime(0) NULL DEFAULT NULL COMMENT '订单取消时间',
  `order_status_refund` smallint(0) NULL DEFAULT NULL COMMENT '申请退款时订单状态',
  `return_time` datetime(0) NULL DEFAULT NULL COMMENT '申请退款时间',
  `return_frontreason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '前台填写退款理由',
  `return_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '后台批准退款理由',
  `return_op` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '退款操作人',
  `return_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '退款类型',
  `return_part_remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '部分退款备注',
  `return_goods_time` datetime(0) NULL DEFAULT NULL COMMENT '收到退货时间',
  `return_pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付退款时间',
  `type_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单类型编码',
  `type_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单类型名称',
  `mall_order_type_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '电商订单类型编码如果是电商订单，又分成:10、正常单 20、秒杀单 30、团购单 ',
  `mall_order_type_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '电商订单类型名称',
  `mall_order_if_xuni` tinyint(1) NULL DEFAULT 0 COMMENT '是否虚拟商品订单',
  `mall_order_if_ticket` tinyint(1) NULL DEFAULT 0 COMMENT '是否购券订单',
  `mall_order_if_huiyuan` tinyint(1) NULL DEFAULT 0 COMMENT '是否会员商品订单',
  `source_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单来源编码',
  `source_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单来源名称',
  `yuyue_com_id` int(0) NULL DEFAULT NULL COMMENT '预约机场Id',
  `yuyue_com_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约机场名称',
  `yuyue_com_hangzhanlou` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约航站楼',
  `yuyue_store_id` int(0) NULL DEFAULT NULL COMMENT '预约店铺',
  `yuyue_store_pos_key` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约店铺编码',
  `yuyue_store_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约店铺名称',
  `yuyue_store_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约店铺电话',
  `yuyue_fetch_time` datetime(0) NULL DEFAULT NULL COMMENT '预约取货时间',
  `yuyue_fetch_expire_time` datetime(0) NULL DEFAULT NULL COMMENT '过期时间',
  `yuyue_status_code` smallint(0) NULL DEFAULT NULL COMMENT '预约状态',
  `yuyue_status_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约状态名称',
  `yuyue_hint_first` tinyint(1) NULL DEFAULT 0 COMMENT '预约首提醒标志',
  `yuyue_hint_second` tinyint(1) NULL DEFAULT 0 COMMENT '预约复提醒标志',
  `private_item_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '私人定制品项名称',
  `private_deliver_date` datetime(0) NULL DEFAULT NULL COMMENT '私人定制交付时间',
  `private_content_desc` varchar(1023) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '私人定制内容描述',
  `private_remark` varchar(1023) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '私人定制特别备注',
  `private_upload_pic` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '私人定制上传图',
  `send_way` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '运输方式',
  `pick_site_id` int(0) NULL DEFAULT NULL COMMENT '自提货点ID',
  `pick_site_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '自提货点名称',
  `pick_time` datetime(0) NULL DEFAULT NULL COMMENT '自提货日期时间',
  `pick_person` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '取货人真实姓名',
  `pick_mobile` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '取货人手机号码',
  `admin_allow_refund` tinyint(1) NULL DEFAULT 0 COMMENT '对于有些订单，如果用户收货后要求退货，则由系统管理员后台强行设置允许退货，由客户在手机端完成退款申请，再由管理员完成退款支付',
  `if_fapiao` tinyint(1) NULL DEFAULT 0 COMMENT '是否开票',
  `fapiao_status` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '开票状态',
  `if_send_crm` tinyint(1) NULL DEFAULT 0 COMMENT '是否已经同步至CRM',
  `add_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NULL DEFAULT 0 COMMENT '逻辑删除',
  `zhuanchang_offer_id` int(0) NULL DEFAULT NULL COMMENT '关联专场拍出价ID',
  `dajiapai_offer_id` int(0) NULL DEFAULT NULL COMMENT '关联大家拍出价ID',
  `private_make_rule_id` int(0) NULL DEFAULT NULL COMMENT '关联私人定制规则ID',
  `auction_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '专场拍还是大家拍类型',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 34 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单表' ROW_FORMAT = Compact;

