DROP TABLE IF EXISTS `litemall_order_goods`;
CREATE TABLE `litemall_order_goods`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `order_id` int(0) NULL DEFAULT NULL COMMENT '订单表的订单ID',
  `goods_id` int(0) NULL DEFAULT NULL COMMENT '商品表的商品ID',
  `goods_name` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '商品名称',
  `goods_sn` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '商品编号',
  `product_id` int(0) NOT NULL COMMENT '商品货品表的货品ID',
  `goods_pos_key` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Pos店码',
  `number` smallint(0) NULL DEFAULT NULL COMMENT '商品货品的购买数量',
  `price` decimal(10, 2) NULL DEFAULT NULL COMMENT '商品货品的售价',
  `specifications` varchar(1023) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品货品的规格列表',
  `pic_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品货品图片或者商品图片',
  `comment` int(0) NULL DEFAULT 0 COMMENT '订单商品评论，如果是-1，则超期不能评价；如果是0，则可以评价；如果其他值，则是comment表里面的评论ID。',
  `add_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NULL DEFAULT 0 COMMENT '逻辑删除',
  `user_goods_rule_id` int(0) NULL DEFAULT NULL COMMENT '关联会员活动ID',
  `sec_rule_id` int(0) NULL DEFAULT NULL COMMENT '关联秒杀活动ID',
  `groupon_rule_id` int(0) NULL DEFAULT NULL COMMENT '关联团购活动ID',
  `rebate_rule_id` int(0) NULL DEFAULT NULL COMMENT '关联品项折扣ID',
  `pay_method_name` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方式名称 1-支付宝 2-微信',
  `order_status_refund` smallint(0) NULL DEFAULT NULL COMMENT '申请退款时订单状态',
  `return_frontreason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '前台填写退款理由',
  `return_time` datetime(0) NULL DEFAULT NULL COMMENT '申请退款时间',
  `cancel_time` datetime(0) NULL DEFAULT NULL COMMENT '订单取消时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `order_id`(`order_id`) USING BTREE,
  INDEX `goods_id`(`goods_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 32 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单商品表' ROW_FORMAT = Compact;

