-- ----------------------------
-- View structure for view_auciton_zhuanchang_order_current
-- ----------------------------
DROP VIEW IF EXISTS `view_auciton_zhuanchang_order_current`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_auciton_zhuanchang_order_current` AS select `a`.`id` AS `id`,`a`.`user_id` AS `user_id`,`a`.`order_id` AS `order_id`,`a`.`rules_id` AS `rules_id`,`a`.`add_time` AS `add_time`,`a`.`update_time` AS `update_time`,`a`.`deleted` AS `deleted`,`a`.`tenant_id` AS `tenant_id`,`a`.`user_create_id` AS `user_create_id`,`a`.`user_modify_id` AS `user_modify_id`,`a`.`op_create_id` AS `op_create_id`,`a`.`op_modify_id` AS `op_modify_id`,`c`.`order_sn` AS `order_sn`,`c`.`order_status` AS `order_status`,`b`.`begin_time` AS `begin_time`,`b`.`end_time` AS `end_time`,`b`.`expire_flag` AS `expire_flag`,`d`.`username` AS `user_name` from (((`litemall_auciton_zhuanchang_order_current` `a` join `litemall_auction_zhuanchang_rule_current` `b` on((`a`.`rules_id` = `b`.`id`))) join `litemall_order` `c` on((`a`.`order_id` = `c`.`id`))) join `litemall_user` `d` on((`c`.`user_id` = `d`.`id`)));

