leted` AS `deleted`,`litemall_wenboguan_article`.`tenant_id` AS `tenant_id`,`litemall_wenboguan_article`.`user_create_id` AS `user_create_id`,`litemall_wenboguan_article`.`user_modify_id` AS `user_modify_id`,`litemall_wenboguan_article`.`op_create_id` AS `op_create_id`,`litemall_wenboguan_article`.`op_modify_id` AS `op_modify_id`,`litemall_wenboguan_article`.`fengmian` AS `fengmian` from `litemall_wenboguan_article` where ((`litemall_wenboguan_article`.`deleted` = 0) and `litemall_wenboguan_article`.`id` in (select `litemall_weboguan_recommend`.`article_id` from `litemall_weboguan_recommend` where (`litemall_weboguan_recommend`.`deleted` = 0)) is false) order by if((`ordernumber` is null),1,0),`ordernumber`,`add_time` desc;

-- ----------------------------
-- Procedure structure for proc_exec
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_exec`;
delimiter ;;
CREATE PROCEDURE `proc_exec`(IN sqlS VARCHAR(16383) CHARACTER SET GBK)
BEGIN
	 SET @sql = sqlS;
	 PREPARE stmt FROM @sql;         -- 预处理动态sql语句
	 EXECUTE stmt ;                        -- 执行sql语句
	 DEALLOCATE PREPARE stmt;      -- 释放prepare
    END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for proc_insert
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_insert`;
delimiter ;;
CREATE PROCEDURE `proc_insert`(IN sqlS VARCHAR(16383) CHARACTER SET GBK,
	OUT id INT)
BEGIN
 SET @sql = sqlS;
	 PREPARE stmt FROM @sql;         -- 预处理动态sql语句
	 EXECUTE stmt ;                        -- 执行sql语句
	 DEALLOCATE PREPARE stmt;      -- 释放prepare
   SELECT @@identity INTO id;
    END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for proc_paging
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_paging`;
delimiter ;;
CREATE PROCEDURE `proc_paging`(IN sqlS VARCHAR(16383) character set GBK,
	OUT total INT)
BEGIN
 SET @sql = sqlS;
	 PREPARE stmt FROM @sql;         -- 预处理动态sql语句
	 EXECUTE stmt ;                        -- 执行sql语句
	 DEALLOCATE PREPARE stmt;      -- 释放prepare
	 SELECT FOUND_ROWS() INTO total ;
    END
;;
delimiter ;

