INSERT INTO `litemall_auction_zhuanchang_goods_current` VALUES (13, 13, NULL, 1181186, '356984', '尚元堂福禄2件套（福禄笔、福禄书签）', 258, '[\"20.2 x 11.1 x 2 CM  \"]', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/61rl1oa55mcifruih61f.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/stiwk84s31lrlia8ffxo.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/emzx3itfgpego17p78uf.jpg\"]', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/9unyb4kh1l86zzea7v0i.jpg', '笔杆形态优美，线条灵动，笔尾的铜头做成葫芦形态。既是实用的书写工具，也是精雅的清玩。葫芦是最原始的吉祥物之一，在传统的审美里具有别样的意义，葫芦谐音“福禄”，是吉祥如意的祝福。', 5000.00, 100.00, 0.00, NULL, 0, 1, 10, NULL, NULL, 1, 3, 0, 0, 0, 0, 1, '不应创建', NULL, '2020-03-16 06:34:30', '2020-09-24 05:23:15', 0, NULL, NULL, NULL, NULL, NULL, 10.00, 0);
INSERT INTO `litemall_auction_zhuanchang_goods_current` VALUES (14, 13, NULL, 1181188, '357106', '尚元堂西湖四季杯垫4件套', 257, '[\"202*202*17.5 mm \"]', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/m5v7yqty03bezjqv3qvp.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/8revsqb3m7rgohnpwxpy.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/fwr2zpylw1lqbdyc48br.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/kycrvptbpg47bw4xrlhg.jpg\"]', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/jjeaehoj156xxqcdxirc.jpg', '西湖四季如画：苏堤春晓、曲院风荷、平湖秋月、断桥残雪，可谓“四时佳兴与人同”。名木酸枝之上，分别镂刻四个景点的特征，一份西湖印象，一份杭州记忆。经开片、刮毛、打磨、髹饰数拾道工艺精制而成，美观而实用，可把玩，可馈赠。', 4000.00, 200.00, 0.00, NULL, 0, 1, 20, NULL, NULL, 1, 4, 0, 0, 0, 0, 1, '不应创建', NULL, '2020-03-16 06:35:11', '2020-09-24 15:19:17', 0, NULL, NULL, NULL, NULL, NULL, 200.00, 0);
INSERT INTO `litemall_auction_zhuanchang_goods_current` VALUES (15, 14, NULL, 1181187, '357105', '尚元堂田园牧歌香具2件套 （田园短卧炉、翎管香筒）', 254, '[\"164*103*49 CM\"]', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/10m69iubis91yto83i3h.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/hioktyxfy64nie8wik93.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/1yjz11u5xr9mk7qgbzf1.jpg\"]', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/bxvp583t7pxev704vljm.jpg', '梯田层层叠叠，高低错落；水牛目视远方，悠然自得；焚香一炷，祥云缭绕，层层叠叠上远山，蜿蜒逶迤绕云间，如诗似画。一轴淡淡水墨画，一曲悠悠田园牧歌。', 500.00, 10.00, 0.00, NULL, 0, 1, 20, NULL, NULL, 1, 2, 0, 0, 0, 0, 1, '不应创建', NULL, '2020-03-16 06:44:29', '2020-06-19 11:00:54', 0, NULL, NULL, NULL, NULL, NULL, 10.00, 0);
INSERT INTO `litemall_auction_zhuanchang_goods_current` VALUES (16, 14, NULL, 1181189, '357107', '尚元堂玲珑416（旗袍书签四件套）', 252, '[\"202*176*17.5mm\"]', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/x4u7ytuscnqc2oo7hvbk.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/18s8kr661uw9ljn9e463.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/vhr7tr24vcirnqjodm9d.jpg\"]', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/et8rt2p7zcazx1xnjtxl.jpg', '一袭旗袍，线条流畅，身姿优雅，风华绝代；一枚书签，名木材质，肤润纹美，工艺精湛。镌刻春兰，兰心蕙质，风姿高雅；夏荷，不染尘泥，古淡清雅；秋菊，不畏风霜，卓尔不群；冬梅，玉骨冰心，高洁脱俗。书海泛舟时，有花香相伴，“红袖添香夜读书”。径寸雅物，形可愉目，意可怡情。', 200.00, 5.00, 0.00, NULL, 0, 1, NULL, NULL, NULL, 1, 1, 0, 0, 0, 0, 1, '不应创建', NULL, '2020-03-16 06:44:29', '2020-06-19 11:00:54', 0, NULL, NULL, NULL, NULL, NULL, 20.00, 0);
INSERT INTO `litemall_auction_zhuanchang_goods_current` VALUES (17, 15, NULL, 1181190, '357108', '尚元堂 腾云笔挂', 251, '[\"430*330*90cm\"]', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/m52ay8tnbdc7flwm0nuc.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/nr2wzm1to190xoh1soql.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/51cj5eb7l832jvl3jgg6.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/9m7ptr9xvgvqkusk9ol1.jpg\"]', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/o32uhs0ooa8vkg6jbuad.jpg', '设计灵感来自《庄子·逍遥游》：底座，如“鲲”之背，鲲化为鹏，穿过仙山，腾云飞升，彩羽飘飘，逍遥自在，流线造型，雅致而稳重。紫光檀镶嵌黄铜，山形装饰片，也可作笔搁，美观实用。底座加装胶垫和黄铜流云形连杆增加了稳定性。顶杆倾斜造型，前后十二个挂点，满足不同尺寸毛笔的悬挂要求。', 1000.00, 50.00, 0.00, NULL, 0, 1, NULL, NULL, NULL, 1, 3, 0, 0, 0, 0, 1, '不应创建', NULL, '2020-03-16 06:48:05', '2020-09-24 06:04:10', 0, NULL, NULL, NULL, NULL, NULL, 50.00, 0);
