INSERT INTO `litemall_auction_zhuanchang_rule_current` VALUES (14, '李文朝书法作品专场拍卖一', NULL, NULL, 4, '中艺韵泓', '李文朝，山东梁山县人，原解放军电视宣传中心（中央电视台军事节目中心）主任，少将军衔，高级记者，新闻传播学硕士研究生导师，享受国务院政府特殊津贴；中国作家协会诗歌委员会副主任，中华诗词学会第三、四届常务副会长（法定代表人），中华诗书画委员会常务副主任；华夏诗词奖第四、五、六届评委会副主任，首届沈鹏诗书画奖评委会执行主任，中华诗词研究院顾问，全国教育书画协会少年书法教育学会特别顾问。著有《李文朝将军诗词选集》、《李文朝诗词诗论选》及新闻专著等11部。参与主创作品获全国五个一工程奖、全国好新闻奖等。诗词作品及手稿著作分别被中国国家图书馆、中国现代文学馆和中国人民革命军事博物馆收藏。', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/9rc2wmpqmpnvo0omze7z.jpg\",\"http://www.gcrdpm.com:8000/wx/storage/fetch/d0ax7gmzb5lx2u6pdvu3.jpg\",\"http://www.gcrdpm.com:8000/wx/storage/fetch/bxk3i444dtxd4cb8yxv1.jpg\",\"http://www.gcrdpm.com:8000/wx/storage/fetch/sl1yqzm9ur9af8itcduh.jpg\"]', NULL, 'http://www.jinyuanbigdata.com:8000/wx/storage/fetch/9ue97e4faoi59z3m32kp.jpg', 2, 2, 0, 0, 0, '2020-07-01 00:00:00', '2020-10-01 00:00:00', 1, 1, 0, 0, 0, 1, NULL, NULL, '2020-06-19 11:00:54', 0, NULL, NULL, NULL, NULL, NULL, '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/adsao5zxzpf1igftx9y6.jpg\"]', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/iakxnla2w2iefcxmgswm.jpg\"]', NULL);
