INSERT INTO `litemall_auction_zhuanchang_rule_current` VALUES (22, '游义云绘画作品 拍卖1', NULL, NULL, 5, '游义云', '游义云（艺云) ，1961年9月出生于湖北黄梅。国家一级美术师，中国书法家协会会员，湖北省书画研究会副主席，中流印社副社长，中华诗词学会会员，中国楹联学会会员，中国民建中央画院院士，湖北省书法家协会理事、隶书委员会委员，湖北省书法院研究员，湖北省作家协会会员，武汉多所大学兼职教授，《书法报》特约评改专家，中国文化部文化行业高技能人才，湖北省中青年优秀文艺人才库成员，湖北省百名书法优秀人才工程成员 。\n 作品曾在全国荣获金银铜奖数十次。获中国书协第二十届中日自作诗书展最高奖“诗书合璧奖”，全国第一届扇面书法大展银奖，文化部全国第八届群星奖，第一届中国书法兰亭奖，“中华世纪之光”全国书画大展金奖，中国诗书画大展铜奖，全国首届青年美术书法大展优秀奖，首届“赵孟頫奖”全国书画大展银奖，书法报•书法海选“兰亭诸子”获奖书家等，并多次入选全国大展。\n应邀参加《书法报》“册页八家谈”“扇面大家谈”“诸子评改”“临与创”等学术栏目。\n先后在《诗刊》《中华诗词》《中国诗歌》《诗词国际》等杂志报刊发表诗词三百余首。曾由中共湖北省委宣传部等单位联合主办的“艺游云海——游义云诗书画作品展”在湖北美术馆隆重举行，以及多种个展。出版有《湖北代表书家作品集•游义云卷》《游义云诗书画作品集》《楹联书法集帖》《书法之桥》以及诗集《落花入水不随尘》、散文集《野蔓斋语》等著作多部。\n\n\n\n    ', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/rz9bdk8u7smwaw1caxlm.tif\",\"http://www.gcrdpm.com:8000/wx/storage/fetch/tdmaomxryi1vj2nin8z7.jpg\"]', '水墨花鸟', 'http://www.jinyuanbigdata.com:8000/wx/storage/fetch/k5he1l2zsr1bz8n46wco.jpg', 10, 1, 0, 0, 0, '2020-06-18 00:00:00', '2020-10-01 00:00:00', 0, 1, 0, 0, 0, 1, NULL, NULL, '2020-07-21 03:44:32', 0, NULL, NULL, NULL, NULL, NULL, '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/2uxczfjrsxlzsd6ieymk.jpg\"]', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/2e8ywo15w9jkzwg2xal0.jpg\"]', NULL);
