INSERT INTO `litemall_authororcorp` VALUES (5, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/rz9bdk8u7smwaw1caxlm.tif\",\"http://www.gcrdpm.com:8000/wx/storage/fetch/tdmaomxryi1vj2nin8z7.jpg\",\"http://www.gcrdpm.com:8000/wx/storage/fetch/trh466pnn4x0ma2ottqx.jpg\"]', NULL, '', NULL, '游义云', NULL, NULL, '刘女士', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-03-16 06:04:40', '2020-07-20 11:51:28', 0, NULL, NULL, NULL, NULL, NULL, '游义云（艺云) ，1961年9月出生于湖北黄梅。国家一级美术师，中国书法家协会会员，湖北省书画研究会副主席，中流印社副社长，中华诗词学会会员，中国楹联学会会员，中国民建中央画院院士，湖北省书法家协会理事、隶书委员会委员，湖北省书法院研究员，湖北省作家协会会员，武汉多所大学兼职教授，《书法报》特约评改专家，中国文化部文化行业高技能人才，湖北省中青年优秀文艺人才库成员，湖北省百名书法优秀人才工程成员 。\n 作品曾在全国荣获金银铜奖数十次。获中国书协第二十届中日自作诗书展最高奖“诗书合璧奖”，全国第一届扇面书法大展银奖，文化部全国第八届群星奖，第一届中国书法兰亭奖，“中华世纪之光”全国书画大展金奖，中国诗书画大展铜奖，全国首届青年美术书法大展优秀奖，首届“赵孟頫奖”全国书画大展银奖，书法报•书法海选“兰亭诸子”获奖书家等，并多次入选全国大展。\n应邀参加《书法报》“册页八家谈”“扇面大家谈”“诸子评改”“临与创”等学术栏目。\n先后在《诗刊》《中华诗词》《中国诗歌》《诗词国际》等杂志报刊发表诗词三百余首。曾由中共湖北省委宣传部等单位联合主办的“艺游云海——游义云诗书画作品展”在湖北美术馆隆重举行，以及多种个展。出版有《湖北代表书家作品集•游义云卷》《游义云诗书画作品集》《楹联书法集帖》《书法之桥》以及诗集《落花入水不随尘》、散文集《野蔓斋语》等著作多部。\n\n\n\n    ');
INSERT INTO `litemall_authororcorp` VALUES (6, '01', '普通', '[]', NULL, '', NULL, '手工艺品', NULL, NULL, '手工匠人', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-03-16 07:02:06', '2020-03-16 07:04:10', 1, NULL, NULL, NULL, NULL, NULL, '仿真的飞机模型，商务送礼、个人收藏、家居摆设，给您缔造一个翱翔蓝天的模型梦');
INSERT INTO `litemall_authororcorp` VALUES (7, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/isnlfw1gl02luix7oe65.jpg\"]', NULL, '中国 北京', NULL, '韦树定', NULL, NULL, '韦先生', '138 1034 6490', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-19 19:53:39', '2020-07-20 11:51:45', 0, NULL, NULL, NULL, NULL, NULL, '    网名韦散木，1988年2月生，广西河池人，壮族。现系中国作家协会《诗刊》诗词编辑，北京语言大学诗词题跋欣赏与写作课程讲师，首都师范大学继续教育学院书法专业诗词课程讲师。《2020诗词日历》主编。著有诗集《无量春愁集》（中国青年出版社）、《行行重行行》（合著，台湾文史哲出版社）。曾获首届“谭克平杯”青年诗词创作奖、黄山龙裔杯特等奖，松江赋提名奖等近百个诗文书法奖项。曾担任全国近百个诗词、书法大赛评委。作品散见于《中国韵文学刊》《中华书画家》《中国书画》《书法报》《书法导报》等各类报刊杂志及央视新闻联播与各大网络传媒。曾在北京举办“消无事福——韦树定楹联书法作品展”。');
INSERT INTO `litemall_authororcorp` VALUES (8, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/7hmt93om6vp450x1dnzx.jpeg\"]', NULL, '', NULL, '李重阳', NULL, NULL, '刘老师', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-21 11:53:52', '2020-07-20 11:51:57', 0, NULL, NULL, NULL, NULL, NULL, '李重阳，现为中国书法家协会会员、湖北省书法家协会草书委员会委员、湖北省书法院创作员，咸宁市书法家协会副主席，曾获第九届楚天群星奖，第九届湖北省“屈原文艺奖”:第二届咸宁文艺奖；入选湖北省文联中青年文艺人才库，入选全省书法“百人工程”');
INSERT INTO `litemall_authororcorp` VALUES (9, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/89u4uho7gr2hnabdcwsw.jpeg\"]', NULL, '', NULL, '姚俊', NULL, NULL, '姚老师', '150 5227 0528', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-21 16:14:26', '2020-07-20 11:52:13', 0, NULL, NULL, NULL, NULL, NULL, '姚俊，中国书画家协会会员，北京艺术交流中心成员，无锡市书法家协会会员。自幼学书，师承著名书法家，法医学家，中国书法家协会会员，无锡市书法家协会主席，新中国第一部法医学著作作者，中国政府法务部特聘教授仲许先生。\n\n从颜柳入手，后习汉隶北碑，隶得力于石门颂，张迁碑，北碑则于郑文公，张黑女碑用功甚勤，形成了章法変化多变，雄强茂密的书风。后从仲许胞弟有“四艺俱通”的著名篆刻家、西泠印社员仲贞子习篆刻。后又受雕塑家、画家、书法家，全国城市雕塑艺术委会委员，北京市人民政府顾问钱绍武的指点，书艺突飞猛进。钱绍武对其小楷写经犹为赞赏，并为其作品题词：诚心写经，必当精进。\n\n获奖情况：\n其名收录于《世界华人书画篆刻家大辞典》。\n作品收录于《中国国际文学艺术博览》，在全国各类书法比赛中获奖数十次。\n中国文学艺术联合会，中国公共关系协会授予书法类特别奖，国学十年个人艺术成就奖。\n作品被中国国际文学艺术作品博览会收藏，创作生平载入《世界名人录》、《世界当代书画篆刻家大辞典》等20多部辞书。');
INSERT INTO `litemall_authororcorp` VALUES (10, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/msdo71kljdrdlkhepb20.jpeg\"]', NULL, '', NULL, '李优良', NULL, NULL, '陈总编', '138 1048 3697', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-22 20:01:04', '2020-07-20 11:52:32', 0, NULL, NULL, NULL, NULL, NULL, '李优良 ，号墨石斋主人，汉族，河南洛阳人，毕业于北京师范大学，供职于人民日报。现为《人民艺术》杂志主编、人民艺术创作院院长、国家新闻出版广电总局质检专家、北京大学访问学者、北大书法艺术研究所特聘研究员，中国武警指挥学院教授、中国书法家协会会员、中华诗词学会会员、中国法治诗书画研究院副院长，北京河南经济文化促进会副会长。');
INSERT INTO `litemall_authororcorp` VALUES (11, '02', 'VIP', '[]', NULL, '', NULL, '朱小砚', NULL, NULL, '刘老师', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-26 22:37:07', '2020-06-26 22:37:07', 0, NULL, NULL, NULL, NULL, NULL, '朱小砚，男，祖籍陕西咸阳。民建会员，现为内蒙古书画研究院院长、内蒙古书画教育协会会长、内蒙古书法家协会第四届副主席、呼和浩特市书法家协会副主席、中国书法家协会会员、中华诗词学会会员、中国楹联学会名誉理事。');
INSERT INTO `litemall_authororcorp` VALUES (12, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/1xbr1qflmdqe8mecmrd0.JPG\"]', NULL, '', NULL, '马福友', NULL, NULL, '白总', '139 1117 5591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-29 16:40:33', '2020-07-12 10:38:50', 0, NULL, NULL, NULL, NULL, NULL, '马福友，祖籍北京。现为中国艺术家协会常务理事，中国艺术家协会书画家研究会常务副会长兼秘书长，国典书画院执行院长。自幼酷爱音乐与绘画，近些年得到诸多绘画界名家悉心指点，潜心钻研，集音乐与绘画于一体，别具一格的把音乐之美融入绘画之中。作品题材生动写实，风格清新自然，形成了自己独特的绘画艺术风格，深受人们的喜爱。他所画的竹，被称为“金竹马”、“北京竹”。其作品被国内外及港澳台地区友人收藏。');
INSERT INTO `litemall_authororcorp` VALUES (13, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/zna093prz1o1sf6rabl8.JPG\"]', NULL, '', NULL, '常文良', NULL, NULL, '白总', '139 1117 5591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-29 16:41:20', '2020-07-12 10:39:25', 0, NULL, NULL, NULL, NULL, NULL, '常文良，出生于北京，“清心斋”主。中国艺术家协会书画家研究会副秘书长、中国书画家联谊会会员、北京市美术家协会会员、中国公共关系协会艺术委员会会员、中华国礼艺术家协会艺术委员。自幼师从中央美院油画系陆育成老师学习素描、国画、水彩画、油画，后又从师于北京画院彭培泉教授和刘振骠、郑克明老师学习花鸟，深得诸位老师的指点，曾多次参加“四城书画展”、“北京浙江金华市书画联展”等，并多次荣获一等奖及推陈出新奖。其作品继承了古人之穿统和现代人的特点，行自己之神韵，深入感受大自然的美，阐述自我的文学和美学语言，形成自己的艺术风格，在创作中不断提升对艺术的感悟和认知。\n');
INSERT INTO `litemall_authororcorp` VALUES (14, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/hoizlu47r48q0qm2xreo.JPG\"]', NULL, '', NULL, '刘敏君', NULL, NULL, '白总', '139 1117 5591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-29 16:42:14', '2020-07-12 10:40:01', 0, NULL, NULL, NULL, NULL, NULL, '刘敏君，教授，画家。毕业于日本东京大学，曾荣获东京大学美学博士学位。中国当代绘画艺术家，国家一级美术师，专业技术评审。现为中国人民大学教授，中国民族艺术研究学院院长，中国艺术家协会会员。其作品参加国内外大型美术展览，多次获奖。近年来，致力于教育事业，在艺术作品创作、学术研究等方面有独特见解。作为“东方神牛”文化艺术研究倡导者，潜心创作以牛为题材的大量传神作品，深得广泛好评。世誉“东方神牛君”。其作品“尽精刻画，写实传神”，画风典雅纯美，富有深刻的哲理性。作品多为国家领导人、国际友人、大中型艺术博物馆收藏。并编入《中国当代艺术家名人录》，出版《刘敏君油画集》、《中国当代实力派名家作品集》、《刘敏均绘画作品选》等专著十余部。');
INSERT INTO `litemall_authororcorp` VALUES (15, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/ty4oxgf4455dnozyoax6.JPG\"]', NULL, '', NULL, '晋心愿', NULL, NULL, '白总', '139 1117 5591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-29 16:43:34', '2020-07-12 10:40:39', 0, NULL, NULL, NULL, NULL, NULL, '晋心愿，字翰豫、义愿居士，河南周口人。自幼酷爱书画艺术，曾师从秦源、王炳尧、马章乘、刘芳廷、王健等名师，受教于王树人、张锦隆、陈天然、周伯涛、阎正等诸多老师的教诲。诸多作品曾发表于各类报刊杂志，以及在中央书画频到展播，部分作品被人民大会堂、郭沫若纪念馆、三军仪仗队以及美国、英国、德国、意大利等国驻华大使馆收藏，出版有《晋心愿榜书书法集》、《晋心愿行楷古诗词书法集》等。现为中国书法协会会员，中国榜书协会会员，中国名人名家书画院院士，中国诗书画协会理事，中国美术名家联合会理事，中国艺术家协会书画研究会理事，中国部长将军书画院特邀书法家等职。');
INSERT INTO `litemall_authororcorp` VALUES (16, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/dvqzqk0pf52jlxbnmc99.JPG\"]', NULL, '', NULL, '傅美生', NULL, NULL, '白总', '139 1117 5591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-29 16:44:31', '2020-07-12 10:41:18', 0, NULL, NULL, NULL, NULL, NULL, '傅美生，山东龙口人。自幼酷爱书法和篆刻艺术，先从事教育工作，后专事篆刻艺术。其作品曾刊登《人民日报》等报刊和媒体。其作品曾参加各类书法艺术比赛和展出，多次获奖。有些作品被国家文博馆收藏。烟台电视台、北京电视台及《北京平房》周报做过专题报道宣传。现为中国艺术家协会书画研究会常务理事，中国海峡两岸书画家协会荣誉副主席，北京华夏傅氏文化研究院副院长，文化部华夏文化遗产保护中心、中国文化遗产保护研究院、人民画院副院长。');
INSERT INTO `litemall_authororcorp` VALUES (17, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/66igbqc322k8rg786iqf.JPG\"]', NULL, '', NULL, '增善', NULL, NULL, '白总', '139 1117 5591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-06-30 10:01:39', '2020-06-30 10:01:39', 0, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `litemall_authororcorp` VALUES (18, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/az00alsvikaxz33aqiey.jpg\"]', NULL, '', NULL, '王玉明', NULL, NULL, '刘老师', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-07-20 11:50:56', '2020-07-20 11:52:49', 0, NULL, NULL, NULL, NULL, NULL, '王玉明，号韫辉（叶嘉莹先生所赐），1941年生，吉林人。清华大学毕业，中国工程院院士。现任清华大学机械工程学院教授，汽车安全与节能国家重点实验室学术委员会主任。获国家技术发明奖和科技进步奖四项（排名1，1，1，3）省部级科技奖11项。中华诗词学会顾问，中国工程院院士书画社理事，清华大学荷塘诗社名誉（创社）社长，已有三本诗集和一本影集出版。');
INSERT INTO `litemall_authororcorp` VALUES (19, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/wf4cbnkcnef08hxzqk8k.jpg\"]', NULL, '', NULL, '李栋恒', NULL, NULL, '刘老师', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-07-20 16:54:59', '2020-07-20 16:54:59', 1, NULL, NULL, NULL, NULL, NULL, '李栋恒，河南南阳人，1968年上海交通大学毕业后到部队农场劳动锻炼。1970年参加中国人民解放军，历任战士、排长，师、军党委秘书，营政治教导员，团政治处主任丶政治委员，师政治部主任、政治委员，总政治部干部部院校处处长，陆军第39集团军政治部主任、副政治委员、政治委员，武装警察部队政治部主任，总装备部副政委。中将军衔。中共第十六届中央委员。第十一届全国政协常委。曾为中国书法家协会会员，中国作家协会会员，中华诗词学会顾问，中国人民解放军红叶诗社社长。主要著作：《李栋恒将军诗词书法选集》(已出4卷)《李栋恒将军诗词选集》等。');
INSERT INTO `litemall_authororcorp` VALUES (20, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/0vadeaynljimahm5xn1m.jpg\"]', NULL, '', NULL, '李殿仁', NULL, NULL, '刘老师', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-07-21 10:30:38', '2020-07-21 10:30:38', 1, NULL, NULL, NULL, NULL, NULL, '李殿仁，原国防大学副政治委员兼纪委书记，教授，中将军衔。1945年11月出生，山东省滨县人。1964年1月入伍，历任战士、班长、干事、秘书、副科长、办公室副主任、军校政治部主任、政治委员等职。第十一届全国人大农业与农村委员会委员。曾任上海大学、北京交通大学、山东省委党校特聘教授，中国二战史学会、中国军事教育学会副会长，中国孙子兵法研究会、中国军事文化研究会顾问等；现任中国国史学会副会长，野草诗社、红叶诗社社长。著有《军旅中的思考》《实践与思考》《思考与解读》《学解孙子兵法》等著作，并有多部诗集出版。主编《跨世纪旋律》《文图并说中国人民解放军大事聚焦》《世界军事形势分析》《孙子兵法通论》《我与改革开放三十年》《孙子兵法谋略新解》、《中国特色军事变革研究》等著作。');
INSERT INTO `litemall_authororcorp` VALUES (21, '02', 'VIP', '[\"http://www.gcrdpm.com:8000/wx/storage/fetch/vxjlkt1kou4iwwnx9s05.jpg\"]', NULL, '', NULL, '张喆', NULL, NULL, '刘老师', '185 1008 0769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-07-21 10:33:47', '2020-07-21 10:34:08', 1, NULL, NULL, NULL, NULL, NULL, '张喆，女，北京人。原广州军区复转军人，中国文化管理协会书画工作委员会理事、中国书画家协会理事、中国部长将军画院办公室主任。现为旅瑞华人书法家。');
