INSERT INTO `litemall_goods` VALUES (1181050, '0401010360', '红螺老北京蜜麻花500g', 1046010, '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/hjr5wmdrc3ms0gvyvbwm.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/odfpa9wfm5geny4ad6vf.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/7blz1ynrfck00m3pb5xg.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/t6swjwcrhepv927ryome.jpg\"]', '', '蜜麻花是北京小吃中常见名品，又称糖耳朵，因为它成形后形状似人的耳朵得名。前人有诗说：“耳朵竟堪作食耶？常偕伴侣蜜麻花，劳声借问谁家好，遥指前边某二巴”。', 1, 100, 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/lnswxkckb2p6zwueow8t.jpg', '', 1, 0, '件', 60.00, 60.00, '<p><img src=\"http:///www.jinyuanbigdata.com:8000/wx/storage/fetch/j9026xj7g6ujssjqys2a.jpg\" width=\"375\" height=\"3174\" /></p>', '2019-06-11 00:05:44', '2020-09-25 15:13:16', 0, 1, '商贸电商', '[\"土特产\"]', '红螺', '6913351004914', NULL, '', 0, 0, 0, 1, NULL, NULL, NULL, NULL, NULL, 681, 0, 1, NULL, '电商专用', NULL, NULL, NULL, NULL, NULL, 1036036, NULL, NULL, NULL, NULL, NULL);
