INSERT INTO `litemall_goods` VALUES (1181123, '9009654283365', '施华洛世奇  ADMIRATION 链坠', 1046017, '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/d1qnr5nmecl09qjf5kg0.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/z233qhf0owipfogsjkpy.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/bn2fr8m2nj03268ja9co.jpg\"]', '', '这款链坠出自由江疏影演绎的挚爱流转系列，恶魔之眼装饰以可移动的蓝色Swarovski仿水晶元素为特色，并巧妙揉合金色金属及密镶Swarovski仿水晶，内里则藏有「LOVE（爱）」字样。而金色饰链上的大尺寸蓝色Swarovski仿水晶，背面也刻有「Love is Around（爱就在身边）」字样。抢眼悦目的护身符设计，彰显出施华洛世奇享誉全球的创新设计及精湛工艺。', 1, 100, 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/c40w438ftb4gpvdujy4p.jpg', '', 1, 1, '条', 5000.00, 5000.00, '<p><img src=\"http:///www.jinyuanbigdata.com:8000/wx/storage/fetch/euwandz681ezx4crllxw.jpg\" width=\"375\" height=\"3767\" /></p>', '2019-06-27 15:35:45', '2020-09-26 06:55:43', 0, 1, '国创荣德拍卖', '[\"首航精品\",\"配饰\"]', '施华洛世奇', '1201092120', 10, '施华洛世奇T3', 0, 0, 0, 1, NULL, NULL, NULL, NULL, NULL, 266, 0, 1, NULL, '私定专用', 5, NULL, NULL, '01', '手工艺品', NULL, '私人定制大师', NULL, NULL, 98, NULL);
INSERT INTO `litemall_goods` VALUES (1181124, '9009654804683', '施华洛世奇 SUNSHINE 套装 CZWH\\ROS SS19', 1046017, '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/mchunzo2vhrs20wbcgm6.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/10495ou1c78sh18ww3p1.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/bufoebkktpdd5vj66fov.jpg\"]', '', '太阳图案，温暖爱意，雅致光韵。您可借着这款优雅迷人的套装向母亲说声「您是我的阳光」！太阳图案代表母亲与女儿之间的独特连结，以及当中的爱意和温暖关怀。而链坠及耳环均镶有金黄色Swarovski仿水晶，可为各种造型注入悦目光彩。随产品附有一条饰链。', 1, 100, 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/c579f9f7dgle7y0197v9.jpg', '', 1, 1, '条', 3000.00, 3000.00, '<p><img src=\"http:///www.jinyuanbigdata.com:8000/wx/storage/fetch/260qrvv5q33ydllkhahj.jpg\" width=\"375\" height=\"3396\" /></p>', '2019-06-27 15:40:17', '2020-09-26 06:53:35', 0, 1, '国创荣德拍卖', '[\"首航精品\",\"配饰\"]', '施华洛世奇', '1201092215', 10, '施华洛世奇T3', 0, 0, 0, 1, NULL, NULL, NULL, NULL, NULL, 265, 0, 1, NULL, '私定专用', 5, NULL, NULL, '01', '手工艺品', NULL, '私人定制大师', NULL, NULL, 98, NULL);
