INSERT INTO `litemall_goods` VALUES (1181189, '357107', '尚元堂玲珑416（旗袍书签四件套）', 1046027, '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/x4u7ytuscnqc2oo7hvbk.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/18s8kr661uw9ljn9e463.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/vhr7tr24vcirnqjodm9d.jpg\"]', '', '一袭旗袍，线条流畅，身姿优雅，风华绝代；一枚书签，名木材质，肤润纹美，工艺精湛。镌刻春兰，兰心蕙质，风姿高雅；夏荷，不染尘泥，古淡清雅；秋菊，不畏风霜，卓尔不群；冬梅，玉骨冰心，高洁脱俗。书海泛舟时，有花香相伴，“红袖添香夜读书”。径寸雅物，形可愉目，意可怡情。', 1, 100, 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/et8rt2p7zcazx1xnjtxl.jpg', '', 1, 0, NULL, 80.00, 80.00, '<p><img src=\"http:///www.jinyuanbigdata.com:8000/wx/storage/fetch/qcmffqak2flbd8arn4wd.jpg\" width=\"375\" height=\"3496\" /></p>', '2019-09-09 17:08:54', '2020-09-26 07:02:02', 0, 1, '国创荣德拍卖', '[\"大兴精品\",\"文创\"]', '经纬', '9402000002489', 25, 'discover', 0, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 683, 0, 1, NULL, '拍卖专用', 4, '01', '手工艺品', '01', '手工艺品', 1036022, '中艺韵泓', NULL, 94, 98, NULL);
INSERT INTO `litemall_goods` VALUES (1181190, '357108', '尚元堂 腾云笔挂', 1046029, '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/m52ay8tnbdc7flwm0nuc.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/nr2wzm1to190xoh1soql.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/51cj5eb7l832jvl3jgg6.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/9m7ptr9xvgvqkusk9ol1.jpg\"]', '', '设计灵感来自《庄子·逍遥游》：底座，如“鲲”之背，鲲化为鹏，穿过仙山，腾云飞升，彩羽飘飘，逍遥自在，流线造型，雅致而稳重。紫光檀镶嵌黄铜，山形装饰片，也可作笔搁，美观实用。底座加装胶垫和黄铜流云形连杆增加了稳定性。顶杆倾斜造型，前后十二个挂点，满足不同尺寸毛笔的悬挂要求。', 1, 100, 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/o32uhs0ooa8vkg6jbuad.jpg', '', 1, 0, NULL, 70.00, 70.00, '<p><img src=\"http:///www.jinyuanbigdata.com:8000/wx/storage/fetch/5wcq08a63evftupkvevr.jpg\" width=\"375\" height=\"3625\" /></p>', '2019-09-12 14:23:38', '2020-09-26 06:58:46', 0, 1, '国创荣德拍卖', '[\"特产\",\"便利\"]', '中艺韵泓', '9402000002490', 25, 'discover', 0, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 682, 0, 1, NULL, '拍卖专用', 4, '01', '手工艺品', NULL, NULL, 1036022, '中艺韵泓', NULL, 94, NULL, NULL);
