INSERT INTO `litemall_private_make_rule` VALUES (2, 5, '私人定制大师', NULL, 1181122, '9009654550368', '施华洛世奇 OUTSTANDING PEAR', 267, '[\"5455036\"]', '01', '手工艺品', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/4dj1ee817c92jx5h2wx2.jpg', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/hw9fbcvz68ikuerz5c0t.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/0p6zopdhdbf2616d3h0t.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/z0kgqvvp627vhzwhdzow.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/ul2gthqf23lf42m7e76e.jpg\"]', 1000.00, NULL, 100.00, 0.00, 0, '2020-03-16 00:00:00', '2021-03-01 00:00:00', 0, 0, 1, 0, NULL, '浪漫心形，为颈肩增添高贵魅力。要找一份别出心裁的礼物？这款时尚优雅的Outstanding梨形链坠，以密镶Swarovski仿水晶的心形金属饰框，搭配红色Swarovski仿水晶，抢眼夺目的设计，展现清新浪漫的气息及施华洛世奇的特有光彩。随产品附有一条镀白金色饰链。', 0, '2020-03-16 07:18:31', '2020-03-16 07:18:31', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `litemall_private_make_rule` VALUES (3, 5, '私人定制大师', NULL, 1181123, '9009654283365', '施华洛世奇  ADMIRATION 链坠', 266, '[\"5428336\"]', '01', '手工艺品', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/c40w438ftb4gpvdujy4p.jpg', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/d1qnr5nmecl09qjf5kg0.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/z233qhf0owipfogsjkpy.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/bn2fr8m2nj03268ja9co.jpg\"]', 2000.00, NULL, 200.00, 0.00, 0, '2020-03-16 00:00:00', '2021-03-01 00:00:00', 0, 0, 1, 0, NULL, '这款链坠出自由江疏影演绎的挚爱流转系列，恶魔之眼装饰以可移动的蓝色Swarovski仿水晶元素为特色，并巧妙揉合金色金属及密镶Swarovski仿水晶，内里则藏有「LOVE（爱）」字样。而金色饰链上的大尺寸蓝色Swarovski仿水晶，背面也刻有「Love is Around（爱就在身边）」字样。抢眼悦目的护身符设计，彰显出施华洛世奇享誉全球的创新设计及精湛工艺。', 0, '2020-03-16 07:18:59', '2020-03-16 07:18:59', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `litemall_private_make_rule` VALUES (4, 5, '私人定制大师', NULL, 1181124, '9009654804683', '施华洛世奇 SUNSHINE 套装 CZWH\\ROS SS19', 265, '[\"5480464\"]', '01', '手工艺品', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/c579f9f7dgle7y0197v9.jpg', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/mchunzo2vhrs20wbcgm6.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/10495ou1c78sh18ww3p1.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/bufoebkktpdd5vj66fov.jpg\"]', 3000.00, NULL, 300.00, 0.00, 0, '2020-03-16 00:00:00', '2021-03-01 00:00:00', 0, 0, 1, 0, NULL, '太阳图案，温暖爱意，雅致光韵。您可借着这款优雅迷人的套装向母亲说声「您是我的阳光」！太阳图案代表母亲与女儿之间的独特连结，以及当中的爱意和温暖关怀。而链坠及耳环均镶有金黄色Swarovski仿水晶，可为各种造型注入悦目光彩。随产品附有一条饰链。', 0, '2020-03-16 07:19:23', '2020-03-16 07:19:23', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `litemall_private_make_rule` VALUES (5, 5, '私人定制大师', NULL, 1181125, '9009652575899', '施华洛世奇 ANNUAL EDITION ORNAMENT 2017挂饰', 264, '[\"5257589\"]', '01', '手工艺品', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/90w0jh2q9kgta7sm9t6u.jpg', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/d1950vzuah15szum794r.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/5iuggl8pioqm3ognoqzx.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/xjtaei0pay0302kyulo0.jpg\"]', 4000.00, NULL, 400.00, 0.00, 0, '2020-03-16 00:00:00', '2021-03-01 00:00:00', 0, 0, 1, 0, NULL, '冰雪奇缘，唯美雪花，闪烁魅力。这款惊艳夺目的雪花挂饰，烘托节日气氛，可为节日注入闪烁魅力', 0, '2020-03-16 07:19:52', '2020-03-16 07:19:52', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `litemall_private_make_rule` VALUES (6, 5, '私人定制大师', NULL, 1181131, '9009654474817', '施华洛世奇 HELLO KITTY 链坠 SEAHORSE LMUL\\RHSSS19', 263, '[\"5447481\"]', '01', '手工艺品', 'https://xiaowan-img.oss-cn-beijing.aliyuncs.com/k39mb5ejs6gopqkloy64.jpg', '', '[\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/mkfsh96cfck6ci39f0d7.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/nkuxa16p6e4suiqwtu8v.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/2ahezmauon3uwb8eufq2.jpg\",\"https://xiaowan-img.oss-cn-beijing.aliyuncs.com/l0hi7xj7tbg748ycm8sw.jpg\"]', 5000.00, NULL, 500.00, 0.00, 0, '2020-03-16 00:00:00', '2021-03-01 00:00:00', 0, 0, 1, 0, NULL, '可爱的海马造型，趣致活泼，玩味十足。这个夏天，就戴上这款玩味十足的Hello Kitty链坠到海边休息一下。除以一身可爱有趣的海马装扮示人，这位全球知名的角色更采用施华洛世奇特有的Pointiage®低温陶瓷镶嵌技术，镶饰闪亮迷人的Swarovski仿水晶，手里更拿着一枚蓝色Swarovski仿水晶珍珠。立体造型加上附赠的镀白金色饰链，所有Hello Kitty粉丝将会爱不释手。', 0, '2020-03-16 07:20:26', '2020-07-04 16:01:50', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
