INSERT INTO `litemall_wenboguan_article` VALUES (4, 107, '书法', NULL, '1', '<p style=\"text-align: center;\"><strong>&nbsp;爱国赋</strong></p>\n<h6>　　尝闻天地之基，在乎人；人之基，在乎家；家之基，在乎国。国兴，则家温馨，人康乐；国亡，则家漂泊，人乱离。衡诸千秋万国，斯言不谬。故人心所系，家国而已矣。</h6>\n<h6 style=\"text-align: left;\">　　中华吾邦，大国泱泱。江河汇流，富五湖烟波之美；峰峦挺秀，饶五岳云霞之幻。气清雨沛，滋养百族，天宝物华，钟灵群彦。既生息繁衍于斯，复周旋卫护于此。醉山河之壮美，岂容践踏；聆鼓鼙之激越，励我担当。于是仁人志士，代代无绝。当协和万邦之时，则励精图治；当存亡危难之际，则前赴后继。忧国赤诚，有屈子独吟江畔；报国精忠，有岳王&ldquo;痛饮黄龙&rdquo;。乃至近代之驱寇守疆，为砥柱磐石者多矣。砥柱磐石者，何也？三字以言之：&ldquo;爱国者&rdquo;也。灿灿群英，长留爱国典范；斑斑史笔，永辉爱国篇章！&nbsp;</h6>\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;世换星移，醒昔年狮寐，看今日龙腾。探海巡天，挺立东方，雄视世界。基实矣，家兴矣，春至矣，脊挺矣。十三亿众，欢歌盛世，共乐升平。当此锦图舒展、伟翼奋张，凝万众一心，颂千秋一国，明我爱国心，坚我报国志。愿我神州，世世代代，民心汇聚，国运昌隆！</p>', '1', NULL, NULL, NULL, 9, 1, NULL, NULL, '2020-08-25 08:39:44', '2020-08-25 22:11:28', 1, NULL, NULL, NULL, NULL, NULL, NULL);
