INSERT INTO `litemall_wenboguan_article` VALUES (11, 107, '书法', NULL, '唐余才作品赏析', '<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/1lhkmzbmbnv12asfjjre.jpg\" width=\"320\" height=\"166\" /></p>\n<p style=\"text-align: center;\">唐余才作品赏析</p>\n<p style=\"font-size: 12px; text-align: left; padding-left: 30px;\">唐余才 48年生人 江苏人 清华大学老年书画研究华会会员<br />共和国60年功勋文艺家 中国部长将军画院高级教授<br />中国名家书画研究会理事长 中国国际书画艺术家协会会员<br />中国中外名人文化研究会会员 中国宝童国际书画院副院长<br />中国文化艺术家协会会员 北京东方传媒书画院副院长</p>\n<p style=\"text-align: left; padding-left: 30px;\">以下是他的一些代表作品：</p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/7muq8iwsesthdr8lhcvf.jpg\" width=\"320\" height=\"193\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/6t16mlpqr8rtohm17kr7.jpg\" width=\"320\" height=\"166\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/0p2ebw77bx7xe1fd97lx.jpg\" width=\"320\" height=\"192\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/6ogljevvoqyjusoy3ah9.jpg\" width=\"320\" height=\"194\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/na6p8alu4xx4vod3txad.jpg\" width=\"320\" height=\"200\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/fjfgk7mzladpix8jgus2.jpg\" width=\"320\" height=\"201\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/0bbsew264sfut8d7n5is.jpg\" width=\"320\" height=\"216\" /></p>\n<p style=\"text-align: left;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/3pjazwez7ptlfquxskov.jpg\" width=\"320\" height=\"217\" /></p>\n<p style=\"text-align: left;\"><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/1nj9208wt8wi4r8bnxqq.jpg\" width=\"160\" height=\"236\" /><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/tth5ax4hdnlsdauvj1mi.jpg\" width=\"160\" height=\"246\" /></p>\n<p style=\"text-align: left;\"><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/v6domq4e4vlttgycq1az.jpg\" width=\"160\" height=\"278\" /><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/nehbxs1p969yxuzwvghr.jpg\" width=\"160\" height=\"264\" /></p>\n<p style=\"text-align: left;\"><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/fd9m1vz9hosffgd8u4gk.jpg\" width=\"160\" height=\"213\" /><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/1pv09suul9bgio5lqu13.jpg\" width=\"160\" height=\"213\" /></p>\n<p style=\"text-align: left;\"><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/modwklzvuekr3hli1n2k.jpg\" width=\"160\" height=\"327\" /><img src=\"http://www.gcrdpm.com:8000/wx/storage/fetch/pq8cx4lg2x4hlzgiayyr.jpg\" width=\"160\" height=\"308\" /></p>\n<p style=\"text-align: left;\">&nbsp;</p>', '国创容德', NULL, '2020-08-26', NULL, 109, 2, NULL, NULL, '2020-08-26 07:45:10', '2020-08-27 23:22:08', 1, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `litemall_wenboguan_article` VALUES (12, 107, '书法', NULL, '唐余才作品赏析', '<p>&nbsp;</p>\n<section>\n<section>\n<section>\n<section class=\"group-empty\">\n<section></section>\n</section>\n<section class=\"group-empty\">\n<section></section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<p><strong>唐余才简历</strong></p>\n</section>\n</section>\n<section>\n<section></section>\n</section>\n</section>\n<section>\n<section>\n<section></section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<p>唐余才，1948年生于江苏。</p>\n<p>清华大学老年书画研究华会会员；<br />共和国60年功勋文艺家；</p>\n<p>中国部长将军画院高级教授；<br />中国名家书画研究会理事长；</p>\n<p>中国国际书画艺术家协会会员；<br />中国中外名人文化研究会会员；</p>\n<p>中国宝童国际书画院副院长中国文化艺术家协会会员；</p>\n<p>北京东方传媒书画院副院长。</p>\n</section>\n</section>\n</section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/441ae54178c07e634f066403d9e6aea3-sz_59448.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.603125\" data-w=\"640\" /></section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://statics.xiumi.us/mat/i/fvId/a7a9db26a084198c856272216429a05d_sz-95727.gif\" data-ratio=\"0.0833333\" data-w=\"1452\" /></section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section></section>\n</section>\n</section>\n</section>\n<section>\n<p><strong>苍劲有力</strong></p>\n<p><strong>飘若浮云</strong></p>\n</section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/5715c03a37f6c2a3bdeb72690fb3fc89-sz_49541.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.605\" data-w=\"800\" /></section>\n</section>\n</section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/11b09560cb431380a760979978045c58-sz_76615.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.9211268\" data-w=\"355\" /></section>\n</section>\n</section>\n<section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/f572a0d3528f9ad9b87cd9b69a68ef3d-sz_88485.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.4746544\" data-w=\"434\" /></section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<p>笔下龙蛇腾跃</p>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section></section>\n</section>\n<section>\n<section>\n<section class=\"group-empty\">\n<section></section>\n</section>\n<section>\n<section>\n<section>\n<p>唐余才书法里融入了儒家的坚毅，果敢和进取，也蕴涵了老庄的虚淡，散远和沉静闲适，还往往以一种不求丰富变化，在运笔中省去尘世浮华以求空远真味的意味。</p>\n</section>\n</section>\n</section>\n<section class=\"group-empty\">\n<section></section>\n</section>\n</section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section></section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<p>朴实无华</p>\n<p>&nbsp;</p>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/83f20765c5a18595066b14343251a507-sz_72549.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.60125\" data-w=\"800\" /></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/51a553375f0c5762057c762295ec6243-sz_49880.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.51625\" data-w=\"800\" /></section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section class=\"group-empty\"></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<p><strong>笔势雄奇，姿态横生</strong></p>\n<p><strong>出于无心，是其手心两忘</strong></p>\n<p><strong>具有了最为生气灌注的特点</strong></p>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section>\n<table class=\"table-box\" width=\"100%\">\n<tbody>\n<tr>\n<td colspan=\"1\" rowspan=\"1\" width=\"50%\">\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/2d34aa082883622adf5d0f5a876e0db5-sz_63811.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.625\" data-w=\"800\" /></section>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/328267e55ab08724bdc0afe7c671010c-sz_64098.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.6734375\" data-w=\"640\" /></section>\n</section>\n</td>\n<td colspan=\"1\" rowspan=\"1\" width=\"50%\">\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/9de06e40b8445f85af5f29cbf2f12870-sz_62873.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.6549296\" data-w=\"426\" /></section>\n</section>\n</td>\n</tr>\n<tr>\n<td colspan=\"1\" rowspan=\"1\" width=\"50%\">\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/6ddef62ff9787399fda90f3e93b9d51e-sz_65785.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.6765625\" data-w=\"640\" /></section>\n</section>\n</td>\n<td colspan=\"1\" rowspan=\"1\" width=\"50%\">\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/826d37c5370ffaf0162bed2ef6e4be58-sz_61388.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.628125\" data-w=\"640\" /></section>\n</section>\n</td>\n</tr>\n</tbody>\n</table>\n</section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<p><strong>赞</strong></p>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<p>唐于才书法里融入了儒家的坚毅，果敢和进取，也蕴涵了老庄的虚淡，散远和沉静闲适，还往往以一种不求丰富变化，在运笔中省去尘世浮华以求空远真味的意味。</p>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/eefbb093eeca1deb68a0569540908115-sz_57201.gif\" data-ratio=\"0.93\" data-w=\"300\" /></section>\n</section>\n<section>\n<p>&nbsp;</p>\n</section>\n</section>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/d40c92207bcae9ff0acf4963cbdc83b7-sz_62358.jpg?x-oss-process=style/xmorient\" data-ratio=\"0.5171875\" data-w=\"640\" /></section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section></section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<p>&nbsp;</p>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://statics.xiumi.us/stc/images/templates-assets/tpl-paper/image/d0638ff05144ec4f953788232f890771-sz_100480.gif\" data-ratio=\"1\" data-w=\"300\" /></section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section></section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<p>&nbsp;</p>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<p>唐余才的字</p>\n<p>是成年累月的象征</p>\n<p>一笔笔铿锵有力</p>\n<p>&nbsp;</p>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/6b8845ade07dec7d4a5fd681e2ef7ddb-sz_80296.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.9496403\" data-w=\"278\" /></section>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/73dae64b91f77937a13fee3875dd0545-sz_130750.gif\" data-ratio=\"1\" data-w=\"300\" /></section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section><img src=\"http://statics.xiumi.us/stc/images/templates-assets/tpl-paper/image/0a61fe6801e43846abbb370eddc05d28-sz_747.svg\" data-ratio=\"0.0933333\" data-w=\"300\" /></section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/53c8fc456c769141004bb6a2b253b1e3-sz_96326.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.5745856\" data-w=\"362\" /></section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/071f3f0d8da3c19cc817b70d41235264-sz_95375.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.8084112\" data-w=\"428\" /></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/305468dced73f78b4e7e2b4a04e98266-sz_123705.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.7391304\" data-w=\"460\" /></section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/d20ad4c2ea514626350ccbd502ecb047-sz_157094.jpg?x-oss-process=style/xmorient\" data-ratio=\"1.7659091\" data-w=\"440\" /></section>\n</section>\n</section>\n</section>\n<section>\n<section>\n<section>\n<section><img src=\"http://statics.xiumi.us/stc/images/templates-assets/tpl-paper/image/f58f1399b1b6a11b8bc9cb11a691732e-sz_760.svg\" data-ratio=\"0.0933333\" data-w=\"300\" /></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section style=\"background-position: 0% 0%; padding: 4px; border-radius: 0px; border: 0px #3e3e3e; width: 98%; background-image: url(\'http://statics.xiumi.us/stc/images/templates-assets/tpl-paper/image/d2e2a5ddebffcaea31012e371a7363ec-sz_351.png\'); background-repeat: repeat; background-attachment: scroll; vertical-align: top; display: inline-block; box-sizing: border-box; background-size: auto; box-shadow: 0px 0px 0px #000000;\">\n<section>\n<section>\n<section>\n<p><strong>古墨轻磨满几香，砚池新浴灿生光、或劲键或婉转，或如婀娜窈窕的美人，或如矫健勇猛的壮士，或如春风拂面繁花一片，或如北风入关深沉冷峻。</strong></p>\n<p><strong>&nbsp;</strong></p>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section>\n<section><img class=\"raw-image\" src=\"http://img.xiumi.us/xmi/ua/23XDg/i/4144bbe993b29c56e41161d8658f61be-sz_27865.gif\" data-ratio=\"1.3663793\" data-w=\"232\" /></section>\n</section>\n</section>', '国创容德', NULL, '2020-08-27', NULL, 2, NULL, NULL, NULL, '2020-08-27 12:21:53', '2020-08-27 12:26:01', 1, NULL, NULL, NULL, NULL, NULL, NULL);
